import React from 'react'
import {
  FlipBook,
  ImageWrapper,
  SectionDesc,
  SectionLayout,
  SectionTitle
} from '../../../SectionsComponents'
import { MarinistLogobook } from './Config'
/*IMAGES*/
const ArrowLeft = '/Assets/Images/Marinist/ArrowLeft.svg'
const ArrowRight = '/Assets/Images/Marinist/ArrowRight.svg'

export const Logobook = () => {
  const goToPrevPage = () => {
    $('.flipbook').turn('previous')
  }
  
  const goToNextPage = () => {
    $('.flipbook').turn('next')
  }
  
  return (
    <SectionLayout id="marinist-logobook">
      <SectionTitle title="Logobook" />
      <SectionDesc />
      <div className="logobook-wrap">
        <FlipBook pages={MarinistLogobook} />
        <div className="logobook-nav">
          <ImageWrapper src={ArrowLeft} className="arrow-left" onClick={goToPrevPage} />
          <p>flip page</p>
          <ImageWrapper src={ArrowRight} className="arrow-right" onClick={goToNextPage} />
        </div>
      </div>
    </SectionLayout>
  )
}
